import React from 'react';
import StarWarsContext from '../context/StarWarsContext';

function Table() {
  return (
    <StarWarsContext.Consumer>

      {({ data }) => (
        <div>
          `planetas $
          {data}
          `
        </div>
      )}

    </StarWarsContext.Consumer>

  );
}
export default Table;
